import React from "react";

import "./index.css";
import GithubIcon from "./components/Icons/GithubIcon";
import {
  createBrowserRouter,
  NavLink,
  Outlet,
  RouterProvider,
} from "react-router-dom";
import DemoWithPageIndicators from "./pages/portfolio/DemoWithPageIndicators";

const router = createBrowserRouter([
  {
    path: "/",
    element: (
      <div>
        <div className="header">
          <NavLink
            to="/"
            className={({ isActive }) => (isActive ? "active" : "")}
          >
            Simple demo
          </NavLink>
          <NavLink
            className={({ isActive }) => (isActive ? "active" : "")}
            to="/demo2"
          >
            Page indicator
          </NavLink>
          <NavLink
            className={({ isActive }) => (isActive ? "active" : "")}
            to="/demo3"
          >
            Nested scroll
          </NavLink>
          <NavLink
            className={({ isActive }) => (isActive ? "active" : "")}
            to="/demo4"
          >
            Nested scroll with indicators
          </NavLink>
        </div>
        <Outlet />
        <a
          href="https://github.com/elhariri/react-page-scroll"
          target="_blank"
          rel="noreferrer"
        >
          <div className="link-to-github">
            <GithubIcon />
            <span style={{ marginLeft: "10px" }}>Github repo!</span>
          </div>
        </a>
      </div>
    ),
    children: [
      {
        path: "/",
        element: <DemoWithPageIndicators />,
      },
      {
        path: "/demo2",
        element: <DemoWithPageIndicators />,
      },
      {
        path: "/demo3",
        element: <DemoWithPageIndicators />,
      },
      {
        path: "/demo4",
        element: <DemoWithPageIndicators />,
      },
    ],
  },
]);

const App = () => {
  return <RouterProvider router={router} />;
};

export default App;
